{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/jarredpriester/using-a-neural-network-to-predict-titanic-survival?scriptVersionId=92407403\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"537a2a2f","metadata":{"papermill":{"duration":0.129363,"end_time":"2022-04-08T01:16:52.444965","exception":false,"start_time":"2022-04-08T01:16:52.315602","status":"completed"},"tags":[]},"source":["# Using a Neural Network to Predict Titanic Survival\n","\n","## Jarred Priester\n","\n","## 12/31/21\n","\n","\n","1. Overview\n","  + 1.1 description of dataset\n","  + 1.2 goal of project\n","  + 1.3 steps to achieve goal\n","2. Data Cleaning\n","  + 2.1 downloading the data\n","  + 2.2 feature engineering\n","  + 2.3 cleaning missing values\n","3. Exploratory Data Analysis\n","  + 3.1 exploring the data\n","  + 3.2 visualization\n","4. Neural Network\n","  + 4.1 Neural Network setup\n","  + 4.2 Neural Network\n","  + 4.3 Results\n","5. Conclusion"]},{"cell_type":"markdown","id":"54cdeea4","metadata":{"papermill":{"duration":0.127149,"end_time":"2022-04-08T01:16:52.700067","exception":false,"start_time":"2022-04-08T01:16:52.572918","status":"completed"},"tags":[]},"source":["# 1. Overview"]},{"cell_type":"markdown","id":"a0ab1a87","metadata":{"papermill":{"duration":0.129761,"end_time":"2022-04-08T01:16:52.95888","exception":false,"start_time":"2022-04-08T01:16:52.829119","status":"completed"},"tags":[]},"source":["# 1.1 description of dataset\n","\n","This is my first attempt at a Kaggle competition. The competition I decided to give a try was the \"Titanic - Machine Learning from Disaster\". This competition will we be using a data set on the passengers of the Titanic. The following is from Kaggle's competition webpage:\n","\n","***The Challenge***\n","\n","*The sinking of the Titanic is one of the most infamous shipwrecks in history.*\n","\n","*On April 15, 1912, during her maiden voyage, the widely considered “unsinkable” RMS Titanic sank after colliding with an iceberg. Unfortunately, there weren’t enough lifeboats for everyone onboard, resulting in the death of 1502 out of 2224 passengers and crew.*\n","\n","*While there was some element of luck involved in surviving, it seems some groups of people were more likely to survive than others.*\n","\n","*In this challenge, we ask you to build a predictive model that answers the question: “what sorts of people were more likely to survive?” using passenger data (ie name, age, gender, socio-economic class, etc).*\n","\n","We are given two data sets. One being titled train and the other being titled test. The train data set consist of the following variables:\n","  \n","* PassendgerId\n","* Survived\n","* Pclass\n","* Name\n","* Sex\n","* Age\n","* SibSp\n","* Parch\n","* Ticket\n","* Fare\n","* Cabin\n","* Embarked\n","  \n","The test data set consist of all the same variables except for the Survived variables. That missing information is what we will be trying to predict in this project."]},{"cell_type":"markdown","id":"e3184d62","metadata":{"papermill":{"duration":0.130133,"end_time":"2022-04-08T01:16:53.218271","exception":false,"start_time":"2022-04-08T01:16:53.088138","status":"completed"},"tags":[]},"source":["# 1.2 goal of the project\n","\n","The first goal of this project is to simply get started with Kaggle by entering into a competition and successfully submitting predictions. Second, I am wanting to share this code in order to help others like myself write their own projects in R and get started with Kaggle. Third, I am wanting to practice using a neural network to make some predictions. Fourth, after looking at other scores on the leaderboard a score of 80% accuracy look like a good score so we will use that as our benchmark for this project."]},{"cell_type":"markdown","id":"c6e53773","metadata":{"papermill":{"duration":0.127485,"end_time":"2022-04-08T01:16:53.472509","exception":false,"start_time":"2022-04-08T01:16:53.345024","status":"completed"},"tags":[]},"source":["# 1.3 steps to achieve the goal\n","\n","We will be applying a neural network using the nnet method from the caret library. First we will download the data given to us from Kaggle. Then we will clean up the data set by replacing missing information as well as creating a few new variables. Then we will analyze the data through visualization to help determine which variables are important. Then we will apply the neural network to get our predictions."]},{"cell_type":"markdown","id":"ab2adeff","metadata":{"papermill":{"duration":0.126199,"end_time":"2022-04-08T01:16:53.725184","exception":false,"start_time":"2022-04-08T01:16:53.598985","status":"completed"},"tags":[]},"source":["# 2. Data Cleaning"]},{"cell_type":"markdown","id":"09f77db0","metadata":{"papermill":{"duration":0.129007,"end_time":"2022-04-08T01:16:53.982643","exception":false,"start_time":"2022-04-08T01:16:53.853636","status":"completed"},"tags":[]},"source":["# 2.1 downloading the data"]},{"cell_type":"code","execution_count":1,"id":"4b2c2a5f","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-04-08T01:16:54.248377Z","iopub.status.busy":"2022-04-08T01:16:54.246001Z","iopub.status.idle":"2022-04-08T01:16:57.463648Z","shell.execute_reply":"2022-04-08T01:16:57.461975Z"},"papermill":{"duration":3.351055,"end_time":"2022-04-08T01:16:57.463791","exception":false,"start_time":"2022-04-08T01:16:54.112736","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Loading required package: tidyverse\n","\n","── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[